import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Card from '../dropdown';
import Footer from '../Footer';

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <h1>hello world</h1>
      <Card />
      <Footer />
    </>
  );
}

export default Home;
